import React, { Component } from 'react';

// Style
import { Content } from './GuestDetails.style';

class GuestDetails extends Component{
  render(){
    return (
      <Content>
        <Center>
          <div>Hi Bijeee</div>
        </Center>
      </Content>
    );
  }
}

export default GuestDetails;
